import React, { useState } from 'react';
import arrow from './arrow.svg';
import { GoogleLogin } from '@react-oauth/google';
import './signIn.css';

const clientId = '114509371072-7tarhegmoe9enjf1k3venbm3h7uap4fa.apps.googleusercontent.com';

function SignIn({ onSignUpClick }) {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    return (
      <div className='login-component'>

        {/* Login Form */}
        <form>
          <h1>SIGN IN</h1>
          <input 
          className='email' 
          type='email' 
          name='email' 
          placeholder='Email' 
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required />
          <input 
          className='password' 
          type='password' 
          name='password' 
          placeholder='Password' 
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required />

          <button type="submit" className="btn" id="btn">
            <img src={arrow} alt="arrow" className="arrow-icon" />
          </button>
        </form>

        {/* Divider */}
        <div className="divider">
          <span>OR</span>
        </div>

        {/* Google Button */}
        <div className='google-btn'>
          <GoogleLogin
            clientId={clientId}
            onSuccess={(response) => console.log(response)}
            onError={(error) => console.log('Login failed: ', error)}
          />
        </div>

        <p className='create-account'>Not a member? <span onClick={onSignUpClick}>Sign up now</span></p>

      </div>
    );
}

export default SignIn;
